def timethis(func):
    """
    function wrapper to output function runtime
    """
    @wraps(func)
    def wrapper(*args, **kwargs):
        start = time.time()
        result = func(*args, **kwargs)
        end = time.time()
        log.info(f"{func.__name__} took {end - start} to execute. ")
        return result

    return wrapper